import React, { Component } from 'react'

export default class SignIn extends Component {

    state = {
        firstName: '',
        lastName: '',
        userName: '',
        email: '',

    }
    render() {
        return (
            <div>
                <form>
                    <label>
                        Name:
                        <input type="text" name="name" />
                    </label>
                    <input type="submit" value="Submit" />
                    </form>
            </div>
        )
    }
}
